import React from "react";
export default class Home extends React.Component {
    componentDidMount(){
        fetch("https://api.example.com/items").then(async response=>{
            console.log(await response);
        })
      console.log("mounted");
    }
   
    componentDidUpdate(){
        console.log("updated");
    }
    render(){
        return(
            <div>{this.state.results}</div>
        )
    }
}
